def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""
    result = ""
    words = input1.split()
    for word in words:
        parts = word.split('-')
        for i, part in enumerate(parts):
            if i > 0:
                part = part.capitalize()
            result += part
        result += " "
    return result.strip()
